// Main component
import styled from 'styled-components';

const StyledMain = styled.div`
  max-width: 1200px; // Adjust as needed
  margin: 0 auto;    // Center the content
  padding: 20px;      // Add padding as needed
`;

const Main = ({ children }) => {
  return <StyledMain>{children}</StyledMain>;
};

export default Main;
